<!doctype html>
<html lang="en">

<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Google Events</title>
</head>

<body>
  <div id="app">
    <div data-gtm-restriction="public" data-gtm-link-hierarchy-root="" data-gtm-page-area="2"

        <a class="explore-bar__icon-card explore-bar__icon-card--shadow" href="#d1" data-uet-link-label="About Us"

        <a class="explore-bar__icon-card explore-bar__icon-card--shadow" href="#d2" data-uet-link-label="Newsroom"

        <a class="explore-bar__icon-card explore-bar__icon-card--shadow" href="#d3" data-uet-link-label="Investors"
          data-uet-link-place="3">Investors</a>
        <a class="explore-bar__icon-card explore-bar__icon-card--shadow" href="#d4" data-uet-link-label="Careers"
          data-uet-link-place="4">Careers</a>
        <a class="explore-bar__icon-card explore-bar__icon-card--shadow" href="#d5" data-uet-link-label="Shop"
          data-uet-link-place="5">Shop</a>
      </section>
    </div>
  </div>
  <script type="module" src="/src/main.ts"></script>
</body>

</html>
